import React from 'react';
import {Row, Col, Container, Card, ListGroup, Button, Image} from 'react-bootstrap';
import './app.css';
import './custom.scss';

import Sidebar from "./components/sidebar.js"

class XMApp extends React.Component {
  render (){
      return(
        <Container fluid>
            <Row className='base'>
                <Sidebar/>
                <Col className="main-space">
                    <Col className='main-header'>XM Studio | Feed</Col>
                    <Col className='main-content'></Col>
                </Col>
            </Row>
            
        </Container>
      );
    }

}


export default XMApp;
